drop database if exists negocio;
create database negocio;
use negocio

create table clientes( id_cliente bigint(5) not null auto_increment, nombre_completo_cliente varchar(60),
						direccion_cliente varchar(60), rfc varchar(15),	telefono varchar(10),celular varchar(10),
						correo_cliente varchar(40), primary key (id_cliente));

						
create table empleado(id_empleado bigint(3) not null auto_increment, nombre_completo_empleado varchar(60), 
						direccion_empleado varchar(60),	telefono_empleado varchar(10), correo_empleado varchar(40),
						primary key (id_empleado));
						
create table provedores(id_provedor bigint(3) not null auto_increment, razon_social_provedor varchar(60),
							direccion_provedor varchar(60), telefono_provedor1 varchar(10), telefono_provedor2 varchar(10),
							correo_provedor  varchar(60), primary key (id_provedor));
create table clasificacion_usuarios(id_tipo bigint(3) not null auto_increment, tipo varchar(30), primary key (id_tipo));

create table status_usuario(id_status bigint(2) not null auto_increment, descripcion varchar(30), primary key (id_status));

create table usuarios(id_usuario bigint(3) not null auto_increment, nick_name varchar(30), llave varchar(20), tipo_id bigint(3), 
						status_id bigint(2),primary key (id_usuario), foreign key (tipo_id) references clasificacion_usuarios (id_tipo),
						foreign key (status_id) references status_usuario(id_status));
						
create table usuarios_tiempo(id_tiempo bigint(9) not null auto_increment, id_usuario bigint(3),fecha_ingreso varchar(20), tiempo_trabajado varchar(30),
						primary key(id_tiempo),foreign key(id_usuario) references usuarios(id_usuario));
						
create table categoria_producto(id_categoria bigint(3) not null auto_increment, descripcion_categoria varchar(30), primary key (id_categoria));

create table productos(codigo_barras varchar(30) not null,nombre_producto varchar(80), precio_compra varchar(5),
							precio_venta_mayoreo varchar(5), precio_venta_medio varchar(5), precio_venta_menudeo varchar(5),
							fecha_caducidad varchar(10), categoria_id bigint(3), provedor_id bigint(3),minimos_bodega int(5),
							existencias_bodega int(5),descripcion_producto varchar(200),presentacion varchar(60),status varchar(10),
							primary key (codigo_barras), foreign key (categoria_id) references categoria_producto (id_categoria),
							foreign key (provedor_id) references provedores (id_provedor));
describe productos;
create table ventas_producto(numero_producto bigint(9)not null auto_increment,id_venta int(9), codigo_barras varchar(30), cantidad int(3),
								subtotal varchar(15), fecha_venta varchar(10),usuario_id bigint(3),cliente_id bigint(5), primary key(numero_producto));							




						
 							

